import React from 'react'
import img from "./image/b2.jpg"
// import Cards from "./cards"


const App = () => {

  return (
    <>
     
          <div className="col1  my-5">
            <img src={img} alt=""/>
            <h2>Rock Star</h2>
            <span>This Inter 5 Dish</span>
            <button className="btn">Click Now</button>
          </div>
    
    </>
  )
}

export default App
